import React from 'react'
import {SliderData} from "./SliderData";
const Contact = () => {
    return (
       <>
        {SliderData.map((slide,index) => {
            return (
                <img src={slide.image} alt="travel" />
            )
        })}
       </>
    )
}

export default Contact
